import React from 'react';

export interface LeaderInfo {
    name: string
    image: string
    years: string
    info: string[]
}

export const Leader: React.FC<LeaderInfo> = (props: LeaderInfo) => {
    return <div className='leader'>
        <img src={props.image} alt={props.name} className="leader-image" />
        <div className="leader-name">{props.name}</div>
        <div className="leader-years">{props.years}</div>
        <div className="leader-info">
            <ul>
            {
                props.info.map((v, i) => <li key={i}>{v}</li>)
            }
            </ul>
        </div>
    </div>
}
